Este soneto fue escrito por Bartolomé Cairasco de Figueroa (1538-1610), poeta canario del Siglo de Oro español. Fue uno de los poetas más importantes de las Islas Canarias durante el Renacimiento y se le conoce como el "Divino" Cairasco.
